The     Moliets golf course has been elected the best golf  in Aquitaine in 2005, designed by Robert Trent Jones in 1989  , the course was built in the pine forests of  'les Landes ' and along the coast  . The fairways are spacious , each hole offers a different aspect to the one before;
The most attractive holes, by far however , are the ones on the dunes : the 13,14,15 and 16.

Entirely  built on sand , the course  is easily playable all year .

